const Moves = () => {
    let favrates=[
        {
            title:"Mirzapur ",
            genre:"thriller ",
            language:"english",
            rating:4.5
        },
        {
            title:"Dark",
            genre:"horror",
            language:"english",
            rating:4
        },
        {
            title:"Family man",
            genre:"thriller",
            language:"hindi",
            rating:4.5
        },
        {
            title:"Malgudi Days",
            genre:"philosophy",
            language:"hindi",
            rating:4.9
        },
        {
            title:"Moneyheast",
            genre:"thriller",
            language:"hindi",
            rating:4.8
        }
    ]
    return ( 
        <div className="moves">
        <h1>Favraties of all time</h1>
        <div className="fav">
            {favrates.map((data)=>(
             <div className="favratelist">
                <h2>{data.title}</h2>
                <p>{data.language}/{data.genre}</p>
                <p>{data.rating}‚≠ê</p>
             </div>
            ))}
        </div>
        </div>
     );
}
 
export default Moves;
